    #[test]
    #[cfg(feature = "cuda")]
    fn test_flash_attn_gqa_prefill_cpu_vs_gpu() -> Result<()> {
        use crate::cuda::CudaConfig;

        // --------------------------
        // 测试配置（按要求设置 q_heads=32，head_dim=128）
        // --------------------------
        let cpu_device = DeviceType::Cpu;
        let gpu_device = DeviceType::Cuda(0); // 与 matmul 测试一致的 GPU 设备枚举
        let dtype = DataType::F32;
        let num_q_heads = 32; // 要求：Q头数=32
        let num_kv_heads = 16; // GQA 比例 32:8（合理适配）
        let head_dim = 64;    // 要求：头维度=128
        let max_seq_len = 512; // 最大序列长度（平衡显存占用）
        let q_seq_len = 128;     // Prefill 长度（新输入序列长度）
        let current_kv_len: i32 = 0; // 初始 KV Cache 为空

        // 计算核心维度
        let q_dim = num_q_heads * head_dim; // 32×128=4096
        let kv_dim = num_kv_heads * head_dim; // 8×128=1024

        // --------------------------
        // 1. 显式创建 CPU 张量并填充数据（去掉 setup_tensors）
        // --------------------------
        println!("准备 CPU 测试数据...");
        // Q 张量：形状 [q_seq_len, q_dim]，CPU 端
        let mut q_in_cpu = Tensor::new(&[q_seq_len, q_dim], dtype, cpu_device)?;
        let q_data: Vec<f32> = (0..q_seq_len * q_dim)
            .map(|i| i as f32 * 0.1) // 缩放避免数值溢出
            .collect();
        q_in_cpu.as_f32_mut()?.as_slice_mut()?.copy_from_slice(&q_data);

        // K Cache 张量：形状 [max_seq_len, kv_dim]，CPU 端
        let mut k_cache_cpu = Tensor::new(&[max_seq_len, kv_dim], dtype, cpu_device)?;
        let k_data: Vec<f32> = (0..max_seq_len * kv_dim)
            .map(|i| (i + 100) as f32 * 0.1)
            .collect();
        k_cache_cpu.as_f32_mut()?.as_slice_mut()?.copy_from_slice(&k_data);

        // V Cache 张量：形状 [max_seq_len, kv_dim]，CPU 端
        let mut v_cache_cpu = Tensor::new(&[max_seq_len, kv_dim], dtype, cpu_device)?;
        let v_data: Vec<f32> = (0..max_seq_len * kv_dim)
            .map(|i| (i + 200) as f32 * 0.1)
            .collect();
        v_cache_cpu.as_f32_mut()?.as_slice_mut()?.copy_from_slice(&v_data);

        // Output 张量（CPU 黄金标准用）：形状 [q_seq_len, q_dim]
        let mut output_cpu = Tensor::new(&[q_seq_len, q_dim], dtype, cpu_device)?;

        // KV_Len 张量：形状 [1]，记录当前 KV Cache 长度
        let mut input_kv_len_cpu = Tensor::new(&[1], DataType::I32, cpu_device)?;
        input_kv_len_cpu.as_i32_mut()?.as_slice_mut()?[0] = current_kv_len;

        // --------------------------
        // 2. CPU 计算黄金标准（Prefill 模式）
        // --------------------------
        println!("CPU 执行 FlashAttention GQA Prefill，计算黄金标准...");
        // Prefill 模式：将新 K/V 数据（前 q_seq_len 行）填充到 Cache 起始位置
        let mut k_cache_gold_cpu = k_cache_cpu.clone();
        let mut v_cache_gold_cpu = v_cache_cpu.clone();
        let new_k_slice = k_cache_cpu.as_f32()?.as_slice()?[0..q_seq_len * kv_dim].to_vec();
        let new_v_slice = v_cache_cpu.as_f32()?.as_slice()?[0..q_seq_len * kv_dim].to_vec();
        k_cache_gold_cpu.as_f32_mut()?.as_slice_mut()?[0..q_seq_len * kv_dim].copy_from_slice(&new_k_slice);
        v_cache_gold_cpu.as_f32_mut()?.as_slice_mut()?[0..q_seq_len * kv_dim].copy_from_slice(&new_v_slice);

        // 创建 CPU 端算子并执行
        let flash_attn_cpu = FlashAttnGQA::new(num_q_heads, num_kv_heads, head_dim)?;
        let mut ctx_cpu = OpContext {
            inputs: &[&q_in_cpu.clone(), &k_cache_gold_cpu, &v_cache_gold_cpu, &input_kv_len_cpu.clone()],
            outputs: &mut [&mut output_cpu],
            cuda_config: None,
        };
        flash_attn_cpu.forward(&mut ctx_cpu)?;
        let cpu_result_slice = ctx_cpu.outputs[0].as_f32()?.as_slice()?;

        // --------------------------
        // 3. GPU 执行相同计算（显式创建 GPU 张量）
        // --------------------------
        println!("GPU 执行 FlashAttention GQA Prefill...");
        // CPU 张量拷贝到 GPU（使用参考代码的 to_cuda 接口）
        let q_in_gpu = q_in_cpu.to_cuda(0)?;
        let k_cache_gpu = k_cache_cpu.to_cuda(0)?;
        let v_cache_gpu = v_cache_cpu.to_cuda(0)?;
        let input_kv_len_gpu = input_kv_len_cpu;

        // 显式创建 GPU 端 Output 张量
        let mut output_gpu = Tensor::new(&[q_seq_len, q_dim], dtype, gpu_device)?;

        // 创建 GPU 端算子并执行
        let flash_attn_gpu = FlashAttnGQA::new(num_q_heads, num_kv_heads, head_dim)?;
        let cuda_config = CudaConfig::new()?; // 复用参考代码的 CUDA 配置
        let mut ctx_gpu = OpContext {
            inputs: &[&q_in_gpu, &k_cache_gpu, &v_cache_gpu, &input_kv_len_gpu],
            outputs: &mut [&mut output_gpu],
            cuda_config: Some(&cuda_config),
        };
        flash_attn_gpu.forward(&mut ctx_gpu)?;

        // GPU 同步，确保计算完成
        unsafe { crate::cuda_check!(crate::cuda::ffi::cudaDeviceSynchronize())?; }

        // --------------------------
        // 4. GPU 结果拷回 CPU 并对比
        // --------------------------
        println!("GPU 结果拷回 CPU，验证正确性...");
        let gpu_result_tensor = ctx_gpu.outputs[0].to_cpu()?;
        let gpu_result_slice = gpu_result_tensor.as_f32()?.as_slice()?;

        // 打印前 10 个元素便于调试
        println!("CPU 结果（前 10 个元素）: {:?}", &cpu_result_slice[0..10]);
        println!("GPU 结果（前 10 个元素）: {:?}", &gpu_result_slice[0..10]);

        // 精度验证（与 matmul 测试一致，允许 1e-5 误差）
        assert_close(cpu_result_slice, gpu_result_slice, 1e-3);

        println!("✅ FlashAttention GQA Prefill (q_heads={}, head_dim={}) CPU vs GPU 对比测试通过！", num_q_heads, head_dim);
        Ok(())
    }
